const mailer = require('nodemailer')
const { create_pass_GV } = require('./templates/create_pass')


const getEmailData = (to, name, template, content)=>{
	let data = null

	switch (template){
		case 'create_pass_GV' :
			data = {
				from: 'Admin <phanlac1345@gmail.com>',
				to,
				subject: `Cấp mật khẩu ${name}`,
				html: create_pass_GV(content)
			}
			break
		default:
			data
	}
	return data
}


const sendEmail = (to, name, type, content) => {

	const smtpTransport = mailer.createTransport({		
		service: 'gmail',		 
		auth: {			
			user: 'phanlac1345@gmail.com',
			pass: 'Kamenrider1'
		}

	})

	const mail = getEmailData(to, name, type, content)

	smtpTransport.sendMail(mail, function(error, response) {
		if (error){
			console.log('err',error)
		} else {
			console.log('send mail successfuly!')
		}
	})
	smtpTransport.close()
}

module.exports = { sendEmail }

const express = require('express')
const router = express.Router()

var multer  = require('multer')
var upload = multer({ dest: 'assets/image' })

import controllers from '../controllers/taikhoan.controller'

router.get('/', controllers.index)

// add nhom
router.post('/register', controllers.register)
router.post('/login', controllers.login)

router.post('/changepassword', controllers.doiMatKhau)

// tao danh sach sinh vien import 
router.post('/create', controllers.createStudent)

// cap nhat tai khoan
router.post('/cap-nhat', controllers.capnhat)
// lich su thi cua  tai khoan
router.get('/lich-su-thi/:_idtaikhoan', controllers.lichsuthi)

//image
router.post('/upload-image', upload.single('image'), controllers.uploadImage)
router.post('/update-user', controllers.updateUser)

// tai khoan cua nhom
router.get('/nhom/:_idnhom', controllers.taiKhoanCuaNhom)
// delete loai lop
//router.delete('/:id', controllers.destroy)



module.exports = router

